- input: "TEXT\x1CC00172510\x1C1\x1C\x1CF3XN\x1CWith respect to the Partys expenditures
    for payroll, payroll taxes, and other payroll or employee benefit-related expenses,
    the Party adheres to 11 CFR 300.33, and also follows the Commissions revision
    of the rules as adopted on December 1, 2005. Specifically, the Party pays for
    these costs with 100 percent federal funds when the employee spends more than
    25 percent of his or her time in a month on federal election activity (FEA) or
    activity in connection with a federal election. These expenditures are reported
    on Schedule B for Line 30b.  Alternatively, when an employee does not meet the
    25 percent threshold, the Party allocates these costs as an overhead/administrative
    expense, and reports these disbursements on a Schedule H4 for Line 21a.   The
    transfers from the Partys federal account to the non-federal account were for
    cash flow purposes only.  No non-federal expenditures were made to influence the
    election or defeat of any specific federal candidates, nor has the non-federal
    account paid any expenditures that should have been allocated. \n"
